DROP TABLE IF EXISTS `dnm_invest_rcd`;
CREATE TABLE `dnm_invest_rcd` (
  `id` varchar(31) NOT NULL COMMENT 'id,日期(8)+数据版本(1)+系统版本(1)+系统标识码(3)+业务标识码(3)+业务扩展位(3)+ 用户分表位(2)+随机用户分表位(2)+seq(8)',
  `platform_user_id` varchar(16) NOT NULL COMMENT '平台账户ID',
  `period` tinyint(4) NOT NULL COMMENT '期限',
  `period_type` char(1) NOT NULL COMMENT '期限类型（年Y，月M，天D，秒S）',
  `repay_method` char(1) NOT NULL COMMENT '还款方式（A:一次性还款，B:等额本息，C:等额本金，D:按月付息到期还本）',
  `invest_amt` decimal(20,0) NOT NULL COMMENT '投标金额',
  `invest_date` varchar(8) NOT NULL COMMENT '投标日期',
  `interest_rate_type` char(1) NOT NULL COMMENT '利率类型（天，年）',
  `interest_rate` decimal(8,4) NOT NULL COMMENT '利率',
  `interest_amt` decimal(20,0) NOT NULL COMMENT '投标利息',
  `cost_amt` decimal(20,0) DEFAULT NULL COMMENT '费用金额',
  `price_amt` decimal(20,0) unsigned zerofill DEFAULT NULL COMMENT '奖励金额',
  `fee_rate` decimal(8,4) DEFAULT NULL COMMENT '预估手续费率,由于每个明细标在确认时的费率会变动，比如用户级别达到某一高度时，费率有所优惠，所以这里只是参考',
  `is_finish` char(1) NOT NULL COMMENT '是否回款完毕（Y,N)',
  `memo` varchar(1024) DEFAULT NULL COMMENT '备注',
  `gmt_create` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `platform_user_seq` (`platform_user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

