-- ----------------------------
-- Table structure for `sequence`
-- ----------------------------
DROP TABLE IF EXISTS `sequence`;
CREATE TABLE `sequence` (
  `name` varchar(50) NOT NULL,
  `current_value` int(8) NOT NULL DEFAULT '0',
  `min_value` int(8) DEFAULT '1',
  `max_value` int(8) DEFAULT '99999999',
  `increment` int(8) NOT NULL DEFAULT '1',
  PRIMARY KEY (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

